import React, { useState } from 'react';
import { Container,Row,Col } from 'react-bootstrap';
import { useSelector } from 'react-redux';

function Cart() {
    const list = useSelector((state) => state.cart.product)
  
    return (
    <div> 
    
       
        <Container className='text-center ms-2 '><h1>CARTPAGE</h1></Container>
         {list.map( item =>
            <Container className='cartnum' key={item.id}>
                <Row>
       <Col lg="2"> <div><img src={item.image} className='cartimage' /></div></Col>
       <Col lg='8'> <span>{item.name}</span>
        <span>{item.price}</span></Col>
        </Row>
        </Container>)
       
}
    </div>
      );
}

export default Cart;
